Gets a mutable reference to the value in the entry.

If you need a reference to the `OccupiedEntry` which may outlive the destruction of the `Entry` value, see [`into_mut`](about:blank/struct.OccupiedEntry.html#method.into_mut "method std::collections::hash_map::OccupiedEntry::into_mut").

##### [Â§](#examples-3)Examples

```
use std::collections::HashMap;
use std::collections::hash_map::Entry;

let mut map: HashMap<&str, u32> = HashMap::new();
map.entry("poneyland").or_insert(12);

assert_eq!(map["poneyland"], 12);
if let Entry::Occupied(mut o) = map.entry("poneyland") {
    *o.get_mut() += 10;
    assert_eq!(*o.get(), 22);

